import { Container, Row } from 'react-bootstrap';
function Footer(){
    return(
        <Container fluid='true' className='footer_container p-3 center'>
            <Row><h3>CodeAhead</h3></Row>
            <Row>Visit Us at</Row>
            <hr />
            <Row>copy rights</Row>
        </Container>
    );
}

export default Footer;
